        function getUserDataFolder() {
            var userDataFolder = Folder.userData;
            var aescriptsFolder = Folder(userDataFolder.toString() + "/Aescripts/CursorKit");
            if (!aescriptsFolder.exists) {
                var checkFolder = aescriptsFolder.create();
                if (!checkFolder) {
                    alert("Error creating " + checkFolder.fsName + "\nPlease check the permissions for this folder:\n" + userDataFolder + "\n\nA temp folder will be used instead");
                    aescriptsFolder = Folder.temp;
                }
            }
            return aescriptsFolder.toString();
        }


        function createResourceFile(filename, binaryString, resourceFolder) {

            var myFile = [];

            for (var i = 0; i <= binaryString.length - 1; i++) {

                myFile[i] = new File(resourceFolder + "/" + filename[i]);
                if (!File(myFile[i]).exists) {
                    if (!(isSecurityPrefSet())) {
                        alert("This script requires access to write files.\n" +
                            "Go to the \"General\" panel of the application preferences and make sure " +
                            "\"Allow Scripts to Write Files and Access Network\" is checked.");
                        try {
                            app.executeCommand(2359);
                        }
                        catch (e) {
                            alert(e);
                        }
                        if (!isSecurityPrefSet()) return null;
                    }
                    myFile[i].encoding = "BINARY";
                    myFile[i].open("w");
                    myFile[i].write(binaryString[i]);
                    myFile[i].close();
                }

            }
        }
 

        function isSecurityPrefSet() {
            var securitySetting = app.preferences.getPrefAsLong("Main Pref Section",
                "Pref_SCRIPTING_FILE_NETWORK_SECURITY");
            return (securitySetting == 1);
        }


        function create_Elements() {
            var compL = app.project.activeItem.workAreaDuration;  // comp length (seconds)
            var compRate = app.project.activeItem.frameRate; // comp frame rate
            var compPixel = app.project.activeItem.pixelAspect; // comp pixel aspect
            var cursorFolder = app.project.items.addFolder("CursorComp Folder");


            CursorComp = app.project.items.addComp("CursorComp", compW, compH,compPixel, compL, compRate);
            app.project.activeItem.layers.add(CursorComp);


            var presetPath = File(userDataFolder + "/" + escape("CursorControl.ffx"));
            app.project.activeItem.layer("CursorComp").applyPreset(presetPath);
            app.project.activeItem.layer("CursorComp").property("ADBE Transform Group").property("ADBE Opacity").expression = 'effect("Cursor Control")("Pseudo/08zxigw973-0001")';
            app.project.activeItem.layer("CursorComp").property("ADBE Transform Group").property("ADBE Scale").expression = 'scaleval= effect("Cursor Control")("Pseudo/08zxigw973-0002");[scaleval, scaleval]';


            var imageArrow = "arrowImg.png";
            var imagePath1 = File(userDataFolder + "/" + escape(imageArrow));

            var imageHand = "handImg.png";
            var imagePath2 = File(userDataFolder + "/" + escape(imageHand));

            var imageHandPan = "handImgPan.png";
            var imagePath3 = File(userDataFolder + "/" + escape(imageHandPan));

            var imageHandGrab = "handImgGrab.png";
            var imagePath4 = File(userDataFolder + "/" + escape(imageHandGrab));

            var imageMobile = "mobileImg.png";
            var imagePath5 = File(userDataFolder + "/" + escape(imageMobile));

            var imageText = "textImg.png";
            var imagePath6 = File(userDataFolder + "/" + escape(imageText));


            newFootageItemArrow = app.project.importFile(new ImportOptions(new File(imagePath1)));
            newFootageItemArrow.parentFolder = cursorFolder;

            newFootageItemHand = app.project.importFile(new ImportOptions(new File(imagePath2)));
            newFootageItemHand.parentFolder = cursorFolder;

            newFootageItemPan = app.project.importFile(new ImportOptions(new File(imagePath3)));
            newFootageItemPan.parentFolder = cursorFolder;

            newFootageItemGrab = app.project.importFile(new ImportOptions(new File(imagePath4)));
            newFootageItemGrab.parentFolder = cursorFolder;

            newFootageItemMobile = app.project.importFile(new ImportOptions(new File(imagePath5)));
            newFootageItemMobile.parentFolder = cursorFolder;

            newFootageItemText = app.project.importFile(new ImportOptions(new File(imagePath6)));
            newFootageItemText.parentFolder = cursorFolder;


            ArrowComp = app.project.items.addComp("ArrowComp", compW, compH, 1, compL, compRate);
            ArrowComp.parentFolder = cursorFolder;
            CursorComp.layers.add(ArrowComp);
            ArrowComp.layers.add(newFootageItemArrow);

            HandComp = app.project.items.addComp("HandComp", compW, compH, 1, compL, compRate);
            HandComp.parentFolder = cursorFolder;
            CursorComp.layers.add(HandComp);
            HandComp.layers.add(newFootageItemHand);

            GrabComp = app.project.items.addComp("PanComp", compW, compH, 1, compL, compRate);
            GrabComp.parentFolder = cursorFolder;
            CursorComp.layers.add(GrabComp);
            GrabComp.layers.add(newFootageItemPan);

            PanComp = app.project.items.addComp("GrabComp", compW, compH, 1, compL, compRate);
            PanComp.parentFolder = cursorFolder;
            CursorComp.layers.add(PanComp);
            PanComp.layers.add(newFootageItemGrab);

            MobileComp = app.project.items.addComp("MobileComp", compW, compH, 1, compL, compRate);
            MobileComp.parentFolder = cursorFolder;
            CursorComp.layers.add(MobileComp);
            MobileComp.layers.add(newFootageItemMobile);

            TextComp = app.project.items.addComp("TextComp", compW, compH, 1, compL, compRate);
            TextComp.parentFolder = cursorFolder;
            CursorComp.layers.add(TextComp);
            TextComp.layers.add(newFootageItemText);


            shapeLayer = CursorComp.layers.addShape();
            shapeLayer.moveToEnd()
            shapeLayer.name = "Click";

            var shapeGroup = shapeLayer.property("Contents").addProperty("ADBE Vector Group");
            var ellipse = shapeGroup.property("Contents").addProperty("ADBE Vector Shape - Ellipse");
            ScaleE = ellipse.property("ADBE Vector Ellipse Size");
            ScaleE.setValue([0, 0]);
            var shape = shapeGroup.property("Contents").addProperty("ADBE Vector Graphic - Stroke");
            var stroke = shape.property("ADBE Vector Stroke Color").setValue([0, 0, 0]);
            var WidthE = shape.property("ADBE Vector Stroke Width");
            WidthE.setValue(10);

            var ClickLayer = CursorComp.layer("Click");
            var Color2 = ClickLayer.property("ADBE Effect Parade").addProperty("ADBE Fill");
            ClickLayer.property("ADBE Effect Parade").property("ADBE Fill").property("ADBE Fill-0002").setValue([0.9607, 0.11764, 0.97254]);



            var duration = CursorComp.workAreaDuration;
            CursorComp.workAreaDuration = 1.0;
            CursorComp.workAreaDuration = duration;


            //OPACITY OTHER LAYERS


            var nLayers = CursorComp.numLayers;
            for (var i = 1; i <= nLayers; i++) {
                OpaCity = CursorComp.layer(i).property("ADBE Transform Group").property("ADBE Opacity");
                OpaCity.addKey(0);
                OpaCity.setValueAtTime(0, 0);
                key1 = OpaCity.nearestKeyIndex(1);
                OpaCity.setInterpolationTypeAtKey(key1, HOLD);


                if (CursorComp.layer(i).name == "Click") {

                    OpaCity2 = CursorComp.layer(i).property("ADBE Transform Group").property("ADBE Opacity");


                    while (OpaCity2.numKeys != 0) {
                        OpaCity2.removeKey(1);
                        OpaCity2.setValue(100);
                    }
                }
            }

            OpaCity = CursorComp.layer("ArrowComp").property("ADBE Transform Group").property("ADBE Opacity");
            OpaCity.addKey(0);
            OpaCity.setValueAtTime(0, 100);
            key2 = OpaCity.nearestKeyIndex(1);
            OpaCity.setInterpolationTypeAtKey(key2, HOLD);

            valor = 1;

        }

